import React, { forwardRef } from "react";
import Typewriter from "typewriter-effect";
import comet from "../images/myColor1.png";
import { motion } from "framer-motion";
import "animate.css";

const Home = (props, ref) => {
  return (
    <div className="homeBodyContainer">
      <p className="homeBodyContainer_p1">Hi, my name is</p>
      <div className="matrixText">
        <Typewriter
          onInit={(typewriter) => {
            typewriter
              .changeDeleteSpeed(30)
              .changeDelay(100)
              .pauseFor(200)
              .typeString("Mark Johnston")
              .start();
          }}
        />
      </div>
      <p className="homeBodyContainer_p2">
        I'm a recent grad of
        <span className="homeBodyContainer_p2Span"> Software Development </span>
        specializing in
        <span className="homeBodyContainer_p2Span2"> Web Development. </span>
        Creating unique experiences through the web. Explore my site, learn
        about me and some of the projects I've built.
      </p>
      <div className="btnOneContainer">
        <a href="#" className="homeBtnOne">
          Learn More
        </a>
      </div>
    </div>
  );
};

export default forwardRef(Home);
